tables.table_schema:
CREATE TABLE sensor_data (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    sensor_id INT,
    value FLOAT
);

CREATE TABLE SensorData (
    id INT PRIMARY KEY,
    sensor_id INT,
    timestamp TIMESTAMP,
    reading FLOAT
);

CREATE TABLE SensorMetadata (
    sensor_id INT PRIMARY KEY,
    location VARCHAR(255),
    sensor_type VARCHAR(50),
    installation_date DATE
);

CREATE TABLE EnergyPatterns (
    pattern_id INT PRIMARY KEY,
    pattern_description TEXT,
    energy_saved FLOAT
);

CREATE TABLE SensorData (
    sensor_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    data_value FLOAT
);

CREATE TABLE SensorLocation (
    sensor_id INT PRIMARY KEY,
    location VARCHAR(255)
);

CREATE TABLE EnergyConsumption (
    sensor_id INT PRIMARY KEY,
    consumption_value FLOAT,
    date DATE
);

CREATE TABLE EnergyOptimization (
    optimization_id INT PRIMARY KEY,
    sensor_id INT,
    optimization_strategy VARCHAR(255)
);
